import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import PhaseZero from './pages/PhaseZero';
import PhaseOne from './pages/PhaseOne';
import PhaseTwo from './pages/PhaseTwo';
import PhaseThree from './pages/PhaseThree';
import MealPlanner from './pages/MealPlanner';
import RecipeDatabase from './pages/RecipeDatabase';
import ProgressTracker from './pages/ProgressTracker';
import Navbar from './components/Navbar';
import Footer from './components/Footer';

function App() {
  return (
    <Router>
      <div className="flex flex-col min-h-screen">
        <Navbar />
        <main className="flex-grow px-4">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/phase-0" element={<PhaseZero />} />
            <Route path="/phase-1" element={<PhaseOne />} />
            <Route path="/phase-2" element={<PhaseTwo />} />
            <Route path="/phase-3" element={<PhaseThree />} />
            <Route path="/meal-planner" element={<MealPlanner />} />
            <Route path="/recipes" element={<RecipeDatabase />} />
            <Route path="/progress" element={<ProgressTracker />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
